import React from 'react';



export interface commands{
    arrayLength: 10,
    startSorting: false,
    refreshChart: false
}

export interface BubbleCommandsInterface{
    commands: commands
}

export const initialBubbleCommandsState = {
	commands:{
		arrayLength: 10,
		startSorting: false,
		refreshChart: false
	}
};
